SELECT S.semester_name,S.semester_id FROM (
    SELECT semester_id,COUNT(*) AS student_count FROM Student_Enrolment GROUP BY semester_id ORDER BY student_count DESC
) T JOIN Semesters S ON T.semester_id = S.semester_id LIMIT 1

SELECT DISTINCT T1.area_code FROM (
    SELECT area_code FROM VOTES AS VOTE1 JOIN CONTESTANTS AS C ON VOTE1.contestant_number = C.contestant_number WHERE C.contestant_name = 'Tabatha Gehling'
) AS T1 JOIN (
    SELECT area_code FROM VOTES AS VOTE2 JOIN CONTESTANTS AS C ON VOTE2.contestant_number = C.contestant_number WHERE C.contestant_name = 'Kelly Clauss'
) AS T2 ON T1.area_code = T2.area_code
